import { AllMOVIS } from "../types/MoviesType";

const initalValue = {
  movies: [],
  pageCount: 0,
};

export const moviesReduser = (state = initalValue, action) => {
  switch (action.type) {
    case AllMOVIS:
      return { movies: action.data };
    default:
      return state;
  }
};
